import React, { useEffect, useState } from 'react';
import {
  MDBContainer,
  MDBTabs,
  MDBTabsItem,
  MDBTabsLink,
  MDBTabsContent,
  MDBTabsPane,
  MDBBtn,
  MDBInput,
  MDBTypography,
}
from 'mdb-react-ui-kit';

function SecondForm() {

    const [login, setLogin] = useState();
    const [pw, setPw] = useState();


    const makeLogin = async () => {
        let formData = new FormData(document.getElementById("myForm"));
        const requestOptions = {
          method: 'POST',
          headers: {
            'Accept': 'application/x-www-form-urlencoded',
            'Content-Type': 'application/x-www-form-urlencoded',
          },
          body: formData
        };
        console.log(login, pw)
        fetch('http://localhost:8000/token', requestOptions)
          .then(response => response.json())
          .then(response => {
            console.log(response)
            /* if (response.status === 200) {
              window.location.reload();
            } else {
              setErrorLogin(true)
            } */
          });
    }


    return (
        <form id="myForm">
            <p>{login}</p>
            <p>{pw}</p>
            <input name="username" onChange={(e) => setLogin(e.target.value)} value={login} type='text'></input>
            <input name="password" onChange={(e) => setPw(e.target.value)} value={pw} type='password'></input>
            <button onClick={makeLogin}>Send data</button>
        </form>
    )
}

export default SecondForm;
